import { API } from "../../backend";
import axios from 'axios'
export const getProducts = () => {
  // return fetch(`${API}product`, { method: "GET" })
  //   .then((response) => {
  //     return response.json();
  //   })
  //   .catch((err) => console.log(err));

  return(
    axios.get(`${API}product`)
    .then((response) => {
        return response.json();
      })
    .catch()
  );
};
